&lt;p style=&quot;background-color:#d9eaf7; border: 1px solid transparent; border-radius: 4px; color:#313132; font-size: 16px; padding: 15px;&quot;&gt;

&lt;b&gt;Filter - Date&lt;/b&gt;: Input the date range you want to view results for. Results are broken down by individual days. Results are currently available for the last completed 24 months.&lt;br&gt;

&lt;b&gt;Filter - Site URL&lt;/b&gt;: Input the site URL or URLs if you want to view results for all of the pages of one or more sites. A reminder to input the different versions or spellings of the site URL to capture all results. For example, www.cleanbc.gov.bc.ca and cleanbc.gov.bc.ca are two versions of the site URL for CleanBC.&lt;br&gt;

&lt;b&gt;Filter - Page URL&lt;/b&gt;: Input the page URL or URLs if you want to view results for a specific page or pages. A reminder to input the various potential URL spellings. For example, include and not include the &quot;www&quot;; include and not include the &quot;/&quot; at the end of the URL; etc.&lt;br&gt;

&lt;b&gt;Filter - Marketing Campaign&lt;/b&gt;: Input the Marketing Campaign (UTM tracking code) that you want to view results for.&lt;br&gt;

&lt;b&gt;View or Download More Rows/Columns of Data&lt;/b&gt;: The current live view limit is 25 rows &amp; 50 columns. To view or download more rows/columns of data, use the &quot;Advanced data options&quot; of the &quot;Download Data&quot; option. &lt;a href=&quot;https://www2.gov.bc.ca/gov/content/governments/services-for-government/service-experience-digital-delivery/web-content-development-guides/analytics/download#viewmore&quot; target=&quot;_blank&quot;&gt;Go to the online guide for instructions&lt;/a&gt;.


&lt;br&gt;

&lt;/p&gt;
